def find_zero(xs: list):
    if len(xs) == 2:
        return -xs[0] / xs[1]

    test_roots = [0.0, 1.0, -1.0, 2.0, -2.0, 0.5, -0.5]
    for root in test_roots:
        if abs(poly(xs, root)) < 1e-5:
            return root

    x = 0.5
    for _ in range(10):
        p = poly(xs, x)
        if abs(p) < 1e-5:
            return x
        dp = 0.0
        for i in range(1, len(xs)):
            dp += i * xs[i] * (x ** (i-1))
        x = x - p / dp
    return x

