    s2, e2 = interval2
    s = max(s1, s2)
    e = min(e1, e2)
    if s > e:
        return "NO"
    length = e - s
    if length < 2:
        return "NO"
    if length == 2:
        return "YES"
    if length % 2 == 0:
        return "NO"
    i = 3
    while i * i <= length:
        if length % i == 0:
            return "NO"
        i += 2
    return "YES"

