def fix_spaces(text):
    if not text:
        return text
    result = []
    i = 0
    n = len(text)
    while i < n:
        if text[i] == ' ':
            j = i
            while j < n and text[j] == ' ':
                j += 1
            count = j - i
            result.append('_' if count <= 2 else '-')
            i = j
        else:
            result.append(text[i])
            i += 1
    return ''.join(result)

