def file_name_check(file_name):
    if file_name.count('.') != 1:
        return 'No'
    parts = file_name.split('.')
    if len(parts) != 2:
        return 'No'
    prefix, suffix = parts
    if not prefix or not prefix[0].isalpha():
        return 'No'
    if suffix not in ['txt', 'exe', 'dll']:
        return 'No'
    count_digits = 0
    for char in file_name:
        if char.isdigit():
            count_digits += 1
            if count_digits > 3:
                break
    if count_digits > 3:
        return 'No'
    return 'Yes'

