def sum_squares(lst):
    MOD = 12
    square_set = {0, 3, 6, 9}
    cube_set = {4, 8}
    total = 0
    for i, num in enumerate(lst):
        r = i % MOD
        if r in square_set:
            total += num * num
        elif r in cube_set:
            total += num * num * num
        else:
            total += num
    return total

