def Strongest_Extension(class_name, extensions):
    max_strength = -float('inf')
    best_extension = None
    for ext in extensions:
        cap = sum(1 for c in ext if c.isupper())
        strength = 2 * cap - len(ext)
        if strength > max_strength:
            max_strength = strength
            best_extension = ext
    return f"{class_name}.{best_extension}"

def Strongest_Extension(class_name, extensions):
    best_extension = None
    best_strength = None
    for ext in extensions:
        strength = 0
        for char in ext:
            if char.isupper():
                strength += 1
            elif char.islower():
                strength -= 1
        if best_extension is None or strength > best_strength:
            best_extension = ext
            best_strength = strength
    return class_name + '.' + best_extension

