def even_odd_count(num):
    num = abs(num)
    if num == 0:
        return (1, 0)
    even = 0
    odd = 0
    while num:
        digit = num % 10
        even += 1 - (digit & 1)
        odd += digit & 1
        num //= 10
    return (even, odd)

