def do_algebra(operator, operand):
    prec = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}
    tokens = []
    for i in range(len(operand)):
        if i == 0:
            tokens.append(operand[i])
        else:
            tokens.append(operator[i-1])
            tokens.append(operand[i])

    output = []
    stack = []
    for token in tokens:
        if isinstance(token, int):
            output.append(token)
        else:
            while stack and prec[stack[-1]] > prec[token]:
                output.append(stack.pop())
            stack.append(token)

    while stack:
        output.append(stack.pop())

    stack = []
    for token in output:
        if isinstance(token, int):
            stack.append(token)
        else:
            b = stack.pop()
            a = stack.pop()
            if token == '+':
                stack.append(a + b)
            elif token == '-':
                stack.append(a - b)
            elif token == '*':
                stack.append(a * b)
            elif token == '//':
                stack.append(a // b)
            elif token == '**':
                stack.append(a ** b)

    return stack[0]

