def generate_integers(a, b):
    start = min(a, b)
    end = max(a, b)
    res = []
    for num in range(start, end + 1):
        n = num
        while n:
            if n % 10 % 2 != 0:
                break
            n //= 10
        else:
            res.append(num)
    return res
